Question:Write a C# code snippet that calculates the factorial of a given number. The factorial of a number is the product of all the natural numbers that precede ese número. Es decir, se calcula el factorial de 5 se realiza el producto 5 x 4 x 3 x 2 x 1. 

```c#
public int factorial(int num){
    int factorial=1;
    for(int i=1; i<=num; i++){
        factorial*=i;
    }
    return factorial;
}
```

